import React from 'react';
import { Link } from 'react-router-dom';

function Header() {
  return (
    <header style={styles.header}>
      <h2 style={styles.logo}>Turističke Ture</h2>
      <nav>
        <Link to="/" style={styles.link}>Početna</Link>
        <Link to="/tours" style={styles.link}>Ture</Link>
        <Link to="/login" style={styles.link}>Prijava</Link>
        <Link to="/register" style={styles.link}>Registracija</Link>
      </nav>
    </header>
  );
}

const styles = {
  header: {
    padding: '10px 20px',
    backgroundColor: '#3498db',
    color: 'white',
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
  },
  logo: {
    margin: 0,
  },
  link: {
    color: 'white',
    margin: '0 10px',
    textDecoration: 'none',
  },
};

export default Header;
